function Mail() {
  return (
    <div className='mail'>
      
      <form>
        <input type='email' name='mail' placeholder='enter your email' /><br></br>
        <input type='text' name='subject' /><br></br>
        <textarea rows={10} cols={30}/>

      </form>
    </div>
  )
}

export default Mail
